	public void launchOWA() {
		System.setProperty("webdriver.gecko.driver", "src/driver/geckodriver.exe");
		System.setProperty("Dorg.freemarker.loggerLibrary", "none");

		FirefoxOptions option = new FirefoxOptions();
		//options.addArguments("--start-maximized");
		//options.addArguments("--disable-web-security");
		//options.addArguments("--no-proxy-server");
		
	
        option.setHeadless(true);

		Map<String, Object> prefs = new HashMap<String, Object>();
		prefs.put("credentials_enable_service", false);
		prefs.put("profile.password_manager_enabled", false);
		prefs.put("profile.default_content_setting_values.notifications", 2);
		//options.se("prefs", prefs);

		final ResourceBundle rb = ResourceBundle.getBundle("config");

		driver = new FirefoxDriver(option);
		driver.get(rb.getString("owa_url"));
		driver.manage().timeouts().implicitlyWait(5, TimeUnit.SECONDS);

	}

	@Before()
	public void scenarioSetup(Scenario scenario) throws NullPointerException {
		Reporter.addScenarioLog("Starting to Execute Scenario : " + scenario.getName());
		com.setscenario(scenario);
		this.launchDA();
	}

	@After()
	public void scenarioTearDown(Scenario scenario) throws Exception {

		// Reporter.addScreenCaptureFromPath(com.getScreenshot(driver));
		Reporter.addScenarioLog("Finished Executing Scenario : " + scenario.getName());
		driver.close();
		driver.quit();
	}

