	private void SendMail(String item, String recipient) throws InterruptedException {
		// TODO Auto-generated method stub
		
		(new WebDriverWait(driver, 15)).until(ExpectedConditions.elementToBeClickable(By.cssSelector("button[title='Write a new message (N)']")))
		.click();

		(new WebDriverWait(driver, 15)).until(ExpectedConditions.elementToBeClickable(By.cssSelector("input[aria-label='To']")));
		//.click();
		 WebElement to = driver.findElement(By.cssSelector("input[aria-label='To']"));
		 to.clear();
		 to.sendKeys(recipient);
		 
		// Actions action= new Actions(driver);
		// action.click(to).sendKeys(Keys.ARROW_DOWN).sendKeys(Keys.RETURN).build().perform();
			//to.sendKeys(Keys.RETURN);
			
			
			(new WebDriverWait(driver, 15)).until(ExpectedConditions.elementToBeClickable(By.cssSelector("input[aria-label='Subject,']")))
			.click();
			 WebElement sub = driver.findElement(By.cssSelector("input[aria-label='Subject,']"));
			 sub.sendKeys(item);
				sub.sendKeys(Keys.RETURN);
				
				
				(new WebDriverWait(driver, 15)).until(ExpectedConditions.elementToBeClickable(By.cssSelector("div[aria-label='Message body']")))
				.click();
				 WebElement bod = driver.findElement(By.cssSelector("div[aria-label='Message body']"));
				 bod.sendKeys(item);
					bod.sendKeys(Keys.RETURN);
					
					
					(new WebDriverWait(driver, 15)).until(ExpectedConditions.elementToBeClickable(By.cssSelector("button[title='Send']")))
					.click();
					
					Thread.sleep(3000);
					
					System.out.println(item + " Send to > " +recipient);
								
				
	}



	public void switchToTab() {
		// Switching between tabs using CTRL + tab keys.
		driver.findElement(By.cssSelector("body")).sendKeys(Keys.CONTROL + "\t");
		// Switch to current selected tab's content.
		driver.switchTo().defaultContent();
	}

	public String  foldername1 = null;
	public void createnewfolder(String foldername) throws InterruptedException {

		this.foldername1 = foldername;
		Actions action= new Actions(driver);
		try {
			(new WebDriverWait(driver, 50000)).until(ExpectedConditions.elementToBeClickable(By.cssSelector("span[title='Luke']")));
		    WebElement mailbox = driver.findElement(By.cssSelector("span[title='Luke']"));


		((JavascriptExecutor)driver).executeScript("arguments[0].scrollIntoView(true);", mailbox);
		(new WebDriverWait(driver, 50000)).until(ExpectedConditions.elementToBeClickable(By.cssSelector("span[title='Luke']")));
		Thread.sleep(1000);
		action.contextClick(mailbox).sendKeys(Keys.ARROW_DOWN).sendKeys(Keys.RETURN).build().perform();
			
		System.out.println("Folder Created > " + foldername );
		} catch (Exception e) {
			// TODO: handle exception
		}

		
	
	WebElement currentElement = driver.switchTo().activeElement();
	Thread.sleep(1000);
((JavascriptExecutor)driver).executeScript("arguments[0].scrollIntoView(true);", currentElement);
	currentElement.sendKeys(foldername);
	currentElement.sendKeys(Keys.RETURN);
	//((JavascriptExecutor)driver).executeScript("arguments[0].setAttribute('value', '" + foldername +"')", currentElement);
	}
	
